import React from "react";
import Card from 'react-bootstrap/Card';

const Book = (props) => {
    return (
        <Card style={{ width: '18rem' }}>
            <Card.Body>
                <Card.Title>{props.book.title}</Card.Title>
                <Card.Text>{props.book.description}</Card.Text>
            </Card.Body>
        </Card>
    )
}

export default Book;
